WCF.ACP.Guild={};WCF.ACP.Guild.Games={};WCF.ACP.Guild.Games.GameHandler={_proxy:null,init:function(){this._proxy=new WCF.Action.Proxy({success:$.proxy(this._success,this)});$("#guildSelectApi").change($.proxy(function(a){var b=$(a.currentTarget);if(b.val()!=0){this.getFields(b.val())}else{$("#fieldData").html("")}},this))},getFields:function(a){this._proxy.setOption("data",{actionName:"getFields",className:"guild\\data\\game\\GameAction",parameters:{gameID:a}});this._proxy.sendRequest()},_success:function(b,c,a){$("#fieldData").html(b.returnValues)}};WCF.ACP.Guild.Member={};WCF.ACP.Guild.Member.EnableHandler={_guildID:0,_proxy:null,init:function(a){this._guildID=a;this._proxy=new WCF.Action.Proxy({success:$.proxy(this._success,this)});$(".jsGuildButton").click($.proxy(function(b){var c=$(b.currentTarget);if(c.data("enabled")&&typeof c.data("enabled")!=="undefined"){this.disable(c.data("memberID"),this._guildID)}else{if(!c.data("enabled")&&typeof c.data("enabled")!=="undefined"){this.enable(c.data("memberID"),this._guildID)}else{if(c.data("setuser")){this.setUser(c.data("memberID"),this._guildID,$('input[data-member-id="'+c.data("memberID")+'"]').val(),$('select[data-group-member-id="'+c.data("memberID")+'"]').val(),$('select[data-rank-member-id="'+c.data("memberID")+'"]').val(),$('select[data-role-member-id="'+c.data("memberID")+'"]').val(),$('select[data-ismain-member-id="'+c.data("memberID")+'"]').val())}else{if(c.data("deleteuser")){this.deleteUser(c.data("memberID"),this._guildID)}}}}},this))},disable:function(b,a){this._proxy.setOption("data",{actionName:"disable",className:"guild\\data\\member\\MemberAction",parameters:{memberID:b,guildID:a}});this._proxy.sendRequest()},enable:function(b,a){this._proxy.setOption("data",{actionName:"enable",className:"guild\\data\\member\\MemberAction",parameters:{memberID:b,guildID:a}});this._proxy.sendRequest()},setUser:function(g,d,f,c,e,b,a){this._proxy.setOption("data",{actionName:"setUser",className:"guild\\data\\member\\MemberAction",parameters:{memberID:g,guildID:d,username:f,groupID:c,rankID:e,roleID:b,isMain:a}});this._proxy.sendRequest()},deleteUser:function(b,a){this._proxy.setOption("data",{actionName:"deleteUser",className:"guild\\data\\member\\MemberAction",parameters:{memberID:b,guildID:a}});this._proxy.sendRequest()},_success:function(e,g,d){for(var c=0,a=e.objectIDs.length;c<a;c++){var b=$('tr[data-member-id="'+e.objectIDs[c]+'"]');if(e.actionName=="disable"){b.find(".jsEnableButton").attr("data-enabled",false).data("enabled",false).attr("data-tooltip",b.find(".jsEnableButton").data("enableMessage")).removeClass("fa-check-square-o").addClass("fa-square-o")}else{if(e.actionName=="enable"){b.find(".jsEnableButton").attr("data-enabled",true).data("enabled",true).attr("data-tooltip",b.find(".jsEnableButton").data("disableMessage")).removeClass("fa-square-o").addClass("fa-check-square-o")}else{if(e.actionName=="setUser"){b.find(".columnUserName > .columnUserNameText > .columnUserNameTextData").html(e.returnValues);b.find(".columnUserName > .columnUserNameText").removeClass("invisible");b.find(".columnUserNameForm").addClass("invisible")}else{if(e.actionName=="deleteUser"){b.find(".columnUserName > .columnUserNameText > .columnUserNameTextData").html("");b.find(".columnUserName > .columnUserNameText").addClass("invisible");b.find(".columnUserNameForm").removeClass("invisible")}}}}}var f=new WCF.System.Notification();f.show(function(){})}};